import { compose } from 'recompose'
import { withFirebase } from '../Firebase'


const TodoList = ({todos}) => {
    todos.then(result => console.log(result))

    return(
        <div>
            <h1>ну не знаю</h1>
            {setTimeout(() => {return }, 5000)}
        </div>
    )
}

let getTodos = async (fun, uid) => {
    let todos = await fun(uid)
    if(todos) return todos
}



const todoos = [
    {id: 1, text: 'hello'},
    {id: 2, text: 'hello'},
    {id: 3, text: 'hello'},
    {id: 4, text: 'hello'},
    {id: 5, text: 'hello'}
]
class TodosShowBase extends Component {
    constructor(props) {
        super(props)
    }


    render() { 
        return(
            <div>
                <TodoList todos={getTodos(this.props.firebase.doGetTodos, this.props.uid)}/>
            </div>
        )
    }
}

const TodosShow = compose(withFirebase)(TodosShowBase)

export default TodosShow
